import { Component } from '@angular/core';
import { FormBuilder, FormControl, FormGroup, Validators } from '@angular/forms';
import { CdbResgateRequest } from 'src/app/models/cdb-resgate-request.model';
import { ResgateCdbService } from 'src/app/services/resgate-cdb.service';


@Component({
  selector: 'app-resgate-cdb',
  templateUrl: './resgate-cdb.component.html',
  styleUrls: ['./resgate-cdb.component.css'],
})
export class ResgateCdbComponent {
  constructor(private resgateCdbService: ResgateCdbService, private formBuilder: FormBuilder) 
  { }

  formulario!: FormGroup;
  canShow:boolean = false;
  valorBruno: number = 0;
  valorLiquido: number = 0;



  ngOnInit(): void {
    this.canShow = false;
     this.formulario = this.formBuilder.group({
     valorResgate: [null, [Validators.required,Validators.min(0.01)]],
     quantidadeMes:[null,  [Validators.required,Validators.min(0.01)]]
     })
  }

  obj : CdbResgateRequest = new CdbResgateRequest();

  isFormValid(): boolean {
    return this.formulario.valid;
  };

  resgatarCdb() : void {

    if (this.formulario.valid){    


    this.obj.valorResgate = this.formulario.value.valorResgate;
    this.obj.qtdMes = this.formulario.value.quantidadeMes;;

    console.log('meu click');
    console.log(this.formulario.value);

    this.resgateCdbService.resgatarDois(this.obj).subscribe(
      (data) => {       

        //@ts-ignore
        this.valorBruno = data.valorBruto;
        //@ts-ignore
        this.valorLiquido = data.valorLiquido;
        this.canShow = true;
        this.formulario.reset();
      },
      (error) => {
        console.log('retono do serviço com erro');
        console.log(error);
        this.canShow = false;
      }
    );
    }
  } 

  limparCdb():void{
    this.formulario.reset();
    this.canShow = false;
    this.valorBruno = 0;
    this.valorLiquido = 0;
  }
}
<form class="form-horizontal" [formGroup] ="formulario">
  <div class="input-panel">
    <h2 class="panel-title">CDB Resgate</h2>
  <div class="mb-3">
    <label for="valorResgate" class="form-label">Valor de Resgate</label>
    <input type="number" formControlName="valorResgate" class="form-control" id="valorResgate" placeholder="Informe o valor do resgate">
    <!-- <div *ngIf="formulario.get('valorResgate')?.hasError('required')" class="text-danger">
      O valor é obrigatório.
    </div> -->
    <div *ngIf="formulario.get('valorResgate')?.hasError('min')" class="text-danger">
      O valor deve ser maior que 0.
    </div>
  </div>
  <div class="mb-3">
    <label for="quantidadeMes" class="form-label">Quantidade de Meses</label>
    <input type="number" formControlName="quantidadeMes" class="form-control" id="quantidadeMes" placeholder="informe a quantidade de meses">
    <div *ngIf="formulario.get('quantidadeMes')?.hasError('min')" class="text-danger">
      O valor deve ser maior que 0.
    </div>
  </div>
   <div class="form-group">
    <button (click)="resgatarCdb()" class="btn btn-primary" [disabled]="!isFormValid()">Resgatar</button>
    <button (click)="limparCdb()" class="btn btn-secondary">Limpar</button>
   </div>

  </div>
</form>

<br>

  <div *ngIf="canShow" class="alert alert-success" role="alert">
    <h4 class="alert-heading">Resultado da Solicitação</h4>
    <p>Valor Solicitado : {{valorSolicitado}}</p>
    <hr>
    <p>Rendimento total Bruno : {{valorBruno}}</p>
    <hr>
    <p>Rendimento total líquido : {{valorLiquido}}</p>
  </div>
